import { makeStyles } from '@material-ui/core/styles';

export default makeStyles((theme) => ({
  toolbar: theme.mixins.toolbar,
  content: {
    // flexDirection: 'row',
    backgroundColor: theme.palette.background.default,
    // width: '90%',
    padding: '2%',
  },

  title: {  
    fontWeight: 300,
    textAlign: 'center',
    paddingBottom: '5%'
  },

  prod: {  
    display: 'inline-block',
  },

  price: {  
    display: 'inline-block',
    paddingLeft: '500px',
  },

  more: {  
    display: 'inline-block',
  },




}));
